import Logo from '../../logo/logo'
import select from './select.svg'
import './home.css'
const UnauthenticatedHome = () => {
  const clickNav = (e)=>{
    console.log(e.parentElement)
    e.parentElement.children.map(i => {
      if (i.classList.contains('active') && i !== e.target){
        i.classList.toggle('active')
      }else if (!i.classList.contains('active') && i === e.target){
        i.classList.toggle('active')
      }
    })
  }
  return (
    <>
    <div className="navbar">
      <Logo/>
      <ul className="nav">
        <li onClick={clickNav}>Home</li>
        <li onClick={clickNav}>Our Progress</li>
        <li onClick={clickNav}>Testominals</li>
        <li onClick={clickNav}>Our Develepors</li>
        <li onClick={clickNav}>Contact US</li>
      </ul>
      <div className="loginorregister">
        <span id="login">
          Login
        </span>
        <span>OR</span>
        <span id="register">
          Register
        </span>
      </div>
    </div>
    <img src={select} alt="" width="500px" height="500px" />

    </>
  )
}

export default UnauthenticatedHome
